import React from 'react';
import styles from './styles/SearchBar.module.css';

// componenta primeste props de la parent App
// searcInput state o vom rezolva in componenta App, orice tine de logica vom implementa aici
function SearchBar({searchInput, onChangeInput, onClickSearch}){

    return(
    <div className={styles.searchDiv}>
       <form >
          <input
         className={styles.searchInput}
         type = "text"
         name="searchInput"
         id="searchInput"
         value={searchInput}
         onChange={onChangeInput}
          />
          <button className={styles.searchButton} onClick={onClickSearch}>SEARCH</button>
       </form>
    </div>    
     
    );
}

export default SearchBar;
